import React from 'react';
import Background from '../assets/20221013174526.png';
import {Link} from "react-router-dom";
function Home() {
  return (
    <div className='Home'>
        <div className='Header'
        style={{backgroundImage:`url(${Background})`}}>
            <h2>Welcome to GenshinWiki!</h2>   
        </div>

    </div>
  )
}

export default Home
